//import logo from "../../assets/img/logo.png";
import React from "react";
import { Link } from "react-router-dom";
export default (props) => (
  <aside className="Logo">
    <Link to="/" className="Logo">
      <img src="/" alt="logo" />
    </Link>
  </aside>
);
